pragma solidity ^0.8.0;


import "node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "node_modules/@openzeppelin/contracts/security/Pausable.sol";
import "node_modules/@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "node_modules/@openzeppelin/contracts/utils/Context.sol";
import "node_modules/@openzeppelin/contracts/access/Ownable.sol";

interface TwetherPost{
    function mint(bytes memory text, bytes memory media_url, uint parentTweeth, uint8 tweethType, uint160 author) external returns (uint);
    function like(uint tweethId, uint160 author) external;
    function unlike(uint tweethId, uint160 author) external;
}

contract TwetherProfile is ERC721Enumerable, ERC721Burnable, Pausable, Ownable{

    struct Profile {
        bytes32 name;
        bytes pfp_url;
        bytes bio;
        uint160[] followers;
        mapping (uint160 => uint256) followerIndex;
        uint160[] following;
        mapping (uint160 => uint256) followingIndex;
        uint[] likes;
        mapping (uint => uint) tweethToLikeIndex;
        uint[] posts;
        mapping (uint => uint) tweethToPostIndex;
        uint[] mentions;
        mapping (uint => uint) tweethToMentionIndex;
    }

    TwetherPost private Post;
    uint public pageSize = 100;

    mapping(uint160 => Profile) private profile;

    modifier hasProfile (uint160 user){
        require(_exists(user), "address doesn't have a profile");
        _;
    }

    modifier postContractSet{
        require(address(Post) != address(0),"TweethPost contract is not setup");
        _;
    }

    event NewLike(address indexed from, uint indexed tweeth);
    event NewComment(address indexed from, bytes32 indexed keyword, address indexed mention, uint tweeth, uint comment_id);
    event NewShare(address indexed from, bytes32 indexed keyword, address indexed mention, uint tweeth, uint share_id);
    event NowFollows(address indexed frollower, address indexed following);
    event NewProfile(address indexed _address, bytes32 indexed name);
    event NewTweeth(address indexed from, bytes32 indexed keyword, address indexed mention, uint new_tweeth);
    event ChangedName(address indexed _address, bytes32 name);

    constructor() ERC721("Pro", "PFP"){}

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override (ERC721Enumerable, ERC721){
        require(!paused(), "ERC721Pausable: token transfer while paused");
        super._beforeTokenTransfer(from, to, tokenId);
    }

    /**
     * @dev Returns weather a contracts supports a certain Interface.
     * @param interfaceId of the interface to check.
     * @return True if the contract supports such interface.
     */
    function supportsInterface(bytes4 interfaceId) public view virtual override (ERC721, ERC721Enumerable) returns (bool) {
        return interfaceId == type(IERC721).interfaceId || 
                interfaceId == type(IERC721Metadata).interfaceId || 
                super.supportsInterface(interfaceId);
    }

    function setTweetherPostContract(address _address) external onlyOwner {
        Post = TwetherPost(_address);
    }

    function setPageSize(uint _pageSize) external onlyOwner {
        pageSize = _pageSize;
    }

    function mint(bytes32 _name, bytes memory _pfp_url,bytes memory _bio) external {
        uint160 _id = uint160(_msgSender());
        profile[_id].name = _name;
        profile[_id].pfp_url = _pfp_url;
        profile[_id].bio = _bio;
        super._mint(_msgSender(), _id);
        emit NewProfile(_msgSender(), _name);
    }

    function _addFollowing(uint160 user, uint160 new_following) internal hasProfile(user) hasProfile(new_following) {
        profile[user].followingIndex[new_following] = profile[user].following.length;
        profile[user].following.push(new_following);

        profile[new_following].followerIndex[user] = profile[new_following].following.length;
        profile[new_following].followers.push(user);
    }

    function _addMention(uint160 user, uint tweeth) internal 
                                                    ///hasProfile(user)
                                                    {
        profile[user].tweethToMentionIndex[tweeth] = profile[user].mentions.length;
        profile[user].mentions.push(tweeth);
    }

    function _removeFollowing(uint160 user, uint160 old_following) internal hasProfile(user) hasProfile(old_following) {
        require(profile[user].following.length > 0, "You are not following this address");
        uint i = profile[user].followingIndex[old_following];
        uint total = profile[user].following.length;

        if (i == 0){
            require(profile[user].following[0] == old_following, "You are not following this address");
        }
        //copy the last item in the array into the old following place. This will override the old follower value.
        if (i != (total - 1)){
            profile[user].followingIndex[profile[user].following[total - 1]] = i;
            profile[user].following[i] = profile[user].following[total - 1];
        }
        //pop the last value which now has a duplicate, so it's fine.
        profile[user].following.pop();
        delete profile[user].followingIndex[old_following];
    }

    function _removeFollower(uint160 user, uint160 old_following) internal {

        uint i = profile[old_following].followerIndex[user];
        uint total = profile[old_following].followers.length;

        //copy the last item in the array into the old following place. This will override the old follower value.
        if (i != (total - 1)){
            profile[old_following].followerIndex[profile[old_following].followers[total - 1]] = i;
            profile[old_following].followers[i] = profile[old_following].followers[total - 1];
        }
        //pop the last value which now has a duplicate, so it's fine.
        profile[old_following].followers.pop();
        delete profile[old_following].followerIndex[user];
    }

    function follow(address _address) external {
        uint160 user = uint160(_msgSender());
        uint160 new_following = uint160(_address);
        _addFollowing(user, new_following);
        emit NowFollows(_msgSender(), _address);
    }

    function unfollow(address _address) external {
        uint160 user = uint160(_msgSender());
        uint160 old_following = uint160(_address);

        _removeFollowing(user, old_following);
        _removeFollower(user, old_following);
    }

    function _validateUser() internal returns (uint160){
        uint160 user = uint160(_msgSender());
        require(_exists(user), "address doesnt have a profile");
        return user;
    }

    function editName(bytes32 new_name) external {
        uint160 user = _validateUser();
        profile[user].name = new_name;
        emit ChangedName(_msgSender(), new_name);
    }

    function editPfp(bytes memory new_pfp) external {
        uint160 user = _validateUser();
        profile[user].pfp_url = new_pfp;
    }

    function editBio(bytes memory new_bio) external {
        uint160 user = _validateUser();
        profile[user].bio = new_bio;
    }


    function _addPost(uint160 user, uint tweethId) internal {
        profile[user].tweethToPostIndex[tweethId] = profile[user].posts.length;
        profile[user].posts.push(tweethId);
    }

    function _manageKeywordMention(bytes memory text, uint tweethId) internal returns (uint160, bytes32){
        bytes memory mention = findInString(text, " @");
        bytes32 keyword = bytes32(findInString(text, " #"));
        uint160 mentioned = uint160(stringHexToUint(mention));
        _addMention(mentioned, tweethId);
        return (mentioned, keyword);
    }

    function post(bytes memory text, bytes memory media_url) external postContractSet{
        uint160 user = _validateUser();
        uint tweethId = Post.mint(text, media_url, 0, 0, user);
        _addPost(user, tweethId);
        (uint160  mention, bytes32  keyword) = _manageKeywordMention(text, tweethId);
        emit NewTweeth(_msgSender(), keyword, address(mention), tweethId);
    }

    function comment(bytes memory text, bytes memory media_url, uint onTweeth) external postContractSet{
        uint160 user = _validateUser();        
        uint tweethId = Post.mint(text, media_url, onTweeth, 1, user);
        _addPost(user, tweethId);
        (uint160 mention, bytes32 keyword) = _manageKeywordMention(text, tweethId);
        emit NewComment(_msgSender(), keyword, address(mention), onTweeth, tweethId);
    }

    function share(bytes memory text, bytes memory media_url, uint tweethToShare) external postContractSet{
        uint160 user = _validateUser();        
        uint tweethId = Post.mint(text, media_url, tweethToShare, 2, user);
        _addPost(user, tweethId);
        (uint160  mention, bytes32  keyword) = _manageKeywordMention(text, tweethId);
        emit NewShare(_msgSender(), keyword, address(mention), tweethToShare, tweethId);
    }

    function like(uint tweethId) external postContractSet{
        uint160 user = _validateUser();
        profile[user].tweethToLikeIndex[tweethId] = profile[user].likes.length;
        profile[user].likes.push(tweethId);
        Post.like(tweethId, user);
        emit NewLike(_msgSender(), tweethId);
    }

    function unlike(uint tweethId) external postContractSet{
        uint160 user = _validateUser();
        require(profile[user].likes.length > 0, "You didnt like this post");
        uint i = profile[user].tweethToLikeIndex[tweethId];
        uint total = profile[user].likes.length;

        if (i==0){
            require(profile[user].likes[0] == tweethId, "You didnt like this post");
        } 
        if (i != (total - 1)){
            profile[user].tweethToLikeIndex[ profile[user].likes[total - 1] ] = i;
            profile[user].likes[i] = profile[user].likes[total - 1];
        }
        profile[user].likes.pop();
        delete profile[user].tweethToLikeIndex[tweethId];
        Post.unlike(tweethId, user);
    }

    function findInString(bytes memory textArray, string memory signal) internal pure returns(bytes memory ){
        bytes memory patternFlag = bytes(signal);
        bytes memory response = new bytes(42);
        uint starts;
        bool found = false;
        for (uint i = 0; i <= textArray.length - patternFlag.length; i++) {
            bool flag = true;
            if (!found){
                for (uint j = 0; j < patternFlag.length; j++){
                    if (textArray [i + j] != patternFlag [j]) {
                        flag = false;
                        break;
                    }
                    starts = i;
                }
            }if(flag){
                if (!found){
                    found = true;
                }else{
                    if (textArray[i+1] == bytes1(" ") || i - starts > 42){break;}
                    response[i - starts -1] = textArray[i+1];
                }
            }
        }return response;
    }

    function stringHexToUint(bytes memory _hex) internal returns (uint){
        uint256 number = 0;
        for(uint i=0;i<_hex.length;i++){
            number = number << 4; // or number = number * 16 
            number |= numberFromAscII(_hex[i]); // or number += numberFromAscII(b[i]);
        }
        return number; 
    }

    function numberFromAscII(bytes1 b) internal pure returns (uint8 res) {
        if (b>="0" && b<="9") {
            return uint8(b) - uint8(bytes1("0"));
        } else if (b>="A" && b<="F") {
            return 10 + uint8(b) - uint8(bytes1("A"));
        } else if (b>="a" && b<="f") {
            return 10 + uint8(b) - uint8(bytes1("a"));
        }
        return uint8(b); // or return error ... 
    }


    function getLikesByPerPage(address user, uint page) external view returns (uint[] memory){
        uint total = profile[uint160(user)].likes.length;
        uint160 id = uint160(user);
        uint[] memory response;
        for (uint8 i=0; i < pageSize; i++){
            if(1 - total - pageSize*page - i <= 0 ){break;}
            response[i] = profile[id].likes[total - pageSize*page - i];
        }
        return response;
    }

    function getLastXLikes(address user, uint8 amount) public view returns(uint[] memory){
        uint total = profile[uint160(user)].likes.length;
        uint160 id = uint160(user);
        if (total > amount) {
            uint[] memory response;
            for (uint8 i=0; i < amount; i++){
                if(1 - total - i <= 0 ){break;}
                response[i] = profile[id].likes[total - i];
            }
            return response;
         }else{
            return profile[uint160(user)].likes;
         } 
    }

    function getLast10Likes(address user) external view returns (uint[] memory){
        return getLastXLikes(user, 10);
    }

    function getLast100Likes(address user) external view returns (uint[] memory){
        return getLastXLikes(user, 100);
    }

    function getProfile(address _address) external view returns (bytes32, bytes memory, bytes memory){
        uint user = uint160(_address);
        return (profile[uint160(user)].name, profile[uint160(user)].pfp_url, profile[uint160(user)].bio);
    }

    function getFollowersPerPage(address user, uint8 page) external view returns (uint160[] memory){

        uint total = profile[uint160(user)].followers.length;
        uint160 id = uint160(user);
        uint160[] memory response;
        for (uint8 i=0; i < pageSize; i++){
            if(1 - total - pageSize*page - i <= 0 ){break;}
            response[i] = profile[id].followers[total - pageSize*page - i];
        }
        return response;
    }

    function getFollowingPerPage(address user, uint8 page) external view returns (uint160[] memory){
        uint total = profile[uint160(user)].following.length;
        uint160 id = uint160(user);
        uint160[] memory response = new uint160[](pageSize);
        for (uint8 i=0; i < pageSize; i++){
            if(1 - total - pageSize*page - i <= 0 ){break;}
            response[i] = profile[id].following[total - pageSize*page - i];
            uint a = 2;
            if(1 - total - pageSize*page - i == 0){
                a=3;
            }
        }
        return response;
    }

    function getMentionsPerPage(address user, uint8 page) external view returns (uint[] memory){
        uint total = profile[uint160(user)].mentions.length;
        uint160 id = uint160(user);
        uint[] memory response;
        for (uint8 i=0; i < pageSize; i++){
            if(1 - total - pageSize*page - i <= 0 ){break;}
            response[i] = profile[id].mentions[total - pageSize*page - i];
        }
        return response;
    }

    function getTweethsPerPage(address user, uint page) external view returns (uint[] memory){
        uint total = profile[uint160(user)].posts.length;
        uint160 id = uint160(user);

        uint[] memory response;
        for (uint8 i=0; i < pageSize; i++){
            if(1 - total - pageSize*page - i <= 0 ){break;}
            response[i] = profile[id].posts[total - pageSize*page - i];
        }
        return response;

    }

    function getLastXTweeths(address user, uint8 amount) public view returns (uint[] memory){
        uint total = profile[uint160(user)].posts.length;
        uint160 id = uint160(user);
        if (total > amount) {
            uint[] memory response;
            for (uint8 i=0; i < amount; i++){
                if(1 - total - i <= 0 ){break;}
                response[i] = profile[id].posts[total - i];
            }
            return response;
         }else{
            return profile[uint160(user)].posts;
         } 
    }

    function getLast10Tweeths(address user) external view returns (uint[] memory){
        return getLastXTweeths(user, 10);
    }

    function getLast100Tweeths(address user) external view returns (uint[] memory){
        return getLastXTweeths(user, 100);
    }

    function getTotalTweethsFromProfile(address user) external view returns(uint){
        return profile[uint160(user)].posts.length;
    }

    function getTotalLikesFromProfile(address user) external view returns(uint){
        return profile[uint160(user)].likes.length;
    }

    function getTotalFollowing(address user) external view returns(uint){
        return profile[uint160(user)].following.length;
    }

    function getTotalFollowers(address user) external view returns(uint){
